import React, { useState, useEffect } from 'react';
import store from '../store/store';
import { Redirect, Link } from 'react-router-dom';
import {
	RadioGroup,
	Radio,
	FormLabel,
	FormControlLabel,
	FormControl
} from '@material-ui/core';
import '../styles/addEntry.component.styles.scss';

function AddEntry() {
	const [value, setValue] = React.useState('frontend');
	const [values, setValues] = React.useState('junior');

	const [register, setRegister] = useState(null);

	useEffect(() => {
		store.addChangeListener(onChange);

		return () => {
			return store.removeChangeListener(onChange);
		};
	}, [register]);

	function onChange() {
		setRegister(store.getRegister());
	}

	if (register) {
		store.setRegister();
		return <Redirect to="/" />;
	}
	function handleChange(event) {
		setValue(event.target.value);
	}
	function handleChanges(event) {
		setValues(event.target.value);
	}

	function handleSubmit(event) {
		console.log(event);
	}

	return (
		<>
			<h1>ADD NEW ENTRY </h1>
			<form onSubmit={handleSubmit} className="flex-row addEntry-holder">
				<FormLabel component="legend">Speciality</FormLabel>
				<RadioGroup
					row
					aria-label="Speciality"
					name="speciality"
					value={value}
					onChange={handleChange}
				>
					<FormControlLabel
						value="frontend"
						control={<Radio />}
						label="Front-end"
						labelPlacement="bottom"
					/>
					<FormControlLabel
						value="backend"
						control={<Radio />}
						label="Back-end"
						labelPlacement="bottom"
					/>
					<FormControlLabel
						value="fullstack"
						control={<Radio />}
						label="Full-Stack"
						labelPlacement="bottom"
					/>
				</RadioGroup>

				<FormLabel component="legend">Category</FormLabel>
				<RadioGroup
					row
					aria-label="Categoru"
					name="category"
					value={values}
					onChange={handleChanges}
					labelPlacement="bottom"
				>
					<FormControlLabel
						value="junior"
						control={<Radio />}
						label="Junior"
						labelPlacement="bottom"
					/>
					<FormControlLabel
						value="senior"
						control={<Radio />}
						label="Senior"
						labelPlacement="bottom"
					/>
				</RadioGroup>

				<button type="submit">here</button>
			</form>
		</>
	);
}

export default AddEntry;
